public EnumSet<StorageType> getStorageTypes() {
  EnumSet<StorageType> storageTypes = EnumSet.noneOf(StorageType.class);
  for (DatanodeStorageInfo dsi : getStorageInfos()) {
    storageTypes.add(dsi.getStorageType());
  }
  return storageTypes;
}
